"use strict";$(function(){var e=$("body").addClass("loaded");$("#menu-button").click(function(){e.toggleClass("transition")});var t=0;var n=10;var r=10;var i=".project-thumbnail";var s=$(i).each(function(){$(this).data("top",this.offsetTop)});$(window).scroll(function(){var i=document.body.scrollTop;s.each(function(){if($(this).offset().top+n<i){$(this).addClass("scroll-after")}else{$(this).removeClass("scroll-after")}});var o=Math.floor(i/r);if(o>=0){if(t<o){for(var u=t;u<o;u++){e.addClass("scroll-"+r*(u+1))}}if(t>o){for(var a=o;a<t;a++){e.removeClass("scroll-"+r*(a+1))}}t=o}})});$(window).load(function(){setTimeout(function(){$("#preloader").fadeOut("slow",function(){$("body").addClass("loaded")})},0)})